import './container.css';
import SearchBar from './serchBar';
const AppContainer = () => {
  return (
    <div  className='cover-box'>
        <div className="box  flex-c" >
        <SearchBar/>
        <MessageConatiner/>
        </div>
 

    </div>
  )
}
export default AppContainer;
